function UserLogin() {
  return (
    <div className="container">
      <h1>Sign In</h1>
      <form>
        <label for="email">email address:</label>
        <input type="email" id="email" />
        <br />
        <label for="password">password:</label>
        <input type="password" id="password" />
        <br />

        <button>submit</button>
      </form>
    </div>
  );
}

export default UserLogin;
